import numpy as np
from  math  import sqrt

def again_curve(point_num, idx, local_path):
    temp =[]
    for i in range(idx, idx + point_num):
        x_list = []
        y_list = []
        for box in range(0, point_num):
            x = local_path[i+box][0]
            y = local_path[i+box][1]
            x_list.append([-2*x, -2*y ,1])
            y_list.append((-x*x) - (y*y))

        #TODO: (6) 도로의 곡률 계산
        x_matrix = np.array(x_list)
        y_matrix = np.array(y_list)
        x_trans = x_matrix.T
        try:
            a_matrix = np.linalg.inv(x_trans.dot(x_matrix)).dot(x_trans).dot(y_matrix)
            a = a_matrix[0]
            b = a_matrix[1]
            c = a_matrix[2]
            r = sqrt(abs(a*a+b*b-c))
        except np.linalg.LinAlgError:
            r = 0.01

        temp.append(r)
    print(temp)

